('abhaya1', 'Abhaya', 7569816549, 'O', 'abhaya23@gmail.com', 'marathi', 'hindu', 'maratha', 'india', 'mumbai', 'maharashtra ', 'BDes', 600000, 'I am a designer by profession. I like exploring and creating new patterns and designs. I always strive to be the better version of myself. I believe in never giving up and being a role model to many people like me.\r\n', 'designer', '1987-06-27', 35),
('aisha1', 'Aisha Rifa', 8456123579, 'F', 'aisha@gmail.com', 'Urdu', 'Muslim', 'Ashraf', 'India', 'Hyderabad', 'Telanga', 'MS', 600000, 'I am an Assistant Manager at a MNC. I am a proud member of the LGBTQ Community. I have come across a lot of social pressure and I have faced them boldly. I wish that my partner is also capable of facing and supporting  me in tough situations.\r\n', 'Assistant Manager', '1999-04-15', 23),
('ashnoor1', 'Ashnoor Kaur', 84512654145, 'F', 'ashnoor@gmail.com', 'Punjabi', 'Sikh', 'Rajput', 'India', 'Ludhiana', 'Punjab', 'BCom', 1600000, 'I am an Actor. I have worked with the greats of the industry. One day I wish to become the most successful Pan India Actor and make my family proud. I wish that my partner is also an artist so that our vibes match.\r\n', 'Actor', '1991-12-17', 31),
('fariya1', 'Syed Fariya Taneem', 7542548514, 'F', 'fariya@gmail.com', 'Urdu', 'Muslim', 'Sayyid', 'India', 'Hyderabad', 'Telanga', '10th pass', 900000, 'I am a soap actor. My passion includes modelling and acting. I am looking for a partner who can cook and take care of the family as I wish to focus on my career and would love to continue acting.', 'Actor', '2001-03-24', 21),
('fathima1', 'Fathima Aliza', 754547894251, 'F', 'fathima@gmail.com', 'Urdu', 'Muslim', 'Ashraf', 'India', 'Lucknow', 'Uttar Pradesh', 'Computer Engineer', 400000, 'I am a trained cyber professional who specializes in network and IT infrastructure security. I look after cyberattacks, malware, and the behavior of cyber criminals, and actively seek to anticipate and prevent these attacks. I love listening to music. It acts as a stress buster.', 'Cyber security Analyst', '1999-01-08', 24),
('jash1', 'Jashmir', 4569831572, 'O', 'jash23mir@gmail.com', 'marathi', 'hindu', 'maratha', 'India ', 'Mumbai ', 'maharashtra ', 'BCom', 800000, 'I run my own business. Initially I faced a lot of shame and criticism but I never gave up. I am not ashamed of being a transgender. I am proud of my identity and I am looking for a partner who will accept me the way I am.', 'entrepreneur', '1985-09-19', 37),
('javed1', 'Javed Ali', 8545964212, 'M', 'javed@gmail.com', 'Urdu', 'Muslim', 'Sayyid', 'India', 'Hyderabad', 'Telanga', 'BA, LLB', 600000, 'I am a lawyer by profession. I am interested in playing table tennis. I am a family oriented person. I am looking for an extrovert as my partner. I wish my partner has the ability to cook well', 'Lawyer', '1990-07-08', 32),
('kruthik1', 'Kruthik N Bharadwaj', 63025486021, 'M', 'kruthik@gmail.com', 'Kannada', 'Hindu', 'Brahmin', 'India', 'Bengaluru', 'Karnataka', 'BE , MBA', 1500000, 'I am an Assistant Manager at a Fund House. I am a proud alumni of a prestigious Management Institute of India. I wish that my partner is caring and makes me feel homely. Also, I am a guitarist. I can elate her mood when she is upset.', 'Assistant Manager', '1996-12-15', 26),
('marvin1', 'Marvin Stephens Dan', 8545964212, 'M', 'marvin@gmail.com', 'Hindi', 'Christian', 'Sahotra', 'India', 'Bengaluru', 'Karnataka', 'MS', 1400000, 'I am a national level Cricketer. I was a part of the U-19 team that went on to win the world cup. I believe that one day I\'ll be representing my country at the highest level. \r\n', 'Cricketer', '1994-12-25', 28),
('nid123', 'Nidhi', 5616161565, 'F', 'nid@gmail.com', 'hindi', 'hindu', 'brahmin', 'usa', 'seattle', 'washington', 'be', 700000, 'I am a passionate dancer.  \r\nI am an extrovert. \r\nLove to mingle and interact with people. \r\nMy hobbies are singing and playing guitar.', 'data analyst', '1999-06-19', 23),
('nishanth1', 'Nishanth A R', 7596245683, 'M', 'rhas@gmail.com', 'kannada', 'hindu', 'lingayat', 'india', 'Bengaluru', 'karnataka', 'mba', 800000, 'I am a Businessman.\r\nI am a jovial person. \r\nI interact with a lot of new people. \r\nMy hobbies are playing chess and binge-watching series.', 'entrepreneur', '1999-03-04', 23),
('prajwal1', 'Prajwal Surendra', 8754524125, 'M', 'prajwalsurendra@gmail.com', 'Kannada', 'Hindu', 'Vishwakarma', 'India', 'Bengaluru', 'Karnataka', 'BE', 500000, 'I play chess. My hobby is to watch sports. I have represented my city in inter state cricket tournaments. My dream is to become a professional cricketer and play for India.', 'Cricketer', '1999-12-11', 23),
('prerana1', 'Prerana N S', 5454515421, 'F', 'prerana@gmail.com', 'Kannada', 'Hindu', 'Brahmin', 'India', 'Bengaluru', 'Karnataka', 'MS', 900000, 'I am a trained dancer. I have been learning the artform of Bharatnatyam from over 15 years. I am pursuing my Vidwath in Bharatanatyam. I am also highly interested in sketching and yoga and have won prizes at national level. I am also a passionate actor. I wish to start my own theatre company. I am looking for a supportive partner who is interested in art.', 'Theatre artist', '2001-03-26', 21),
('rahul', 'Rahul R', 4568249673, 'M', 'ram@gmail.com', 'kannada', 'hindu', 'gowda', 'usa', 'los angeles', 'california', 'ms', 700000, 'I love learning new stuff. \r\nI am a travel freak.\r\nI am a foodie. \r\nI was born in India and now settled in US. \r\nI also love trading.', 'Network Security Engineer', '2001-05-04', 21),
('rahul2', 'Rahul T', 8459612347, 'M', 'rahul@gmail.com', 'Kannada', 'Hindu', 'Gowda', 'India', 'Bengaluru', 'Karnataka', 'BA', 300000, 'I am a teacher who teaches in High School. I love imparting knowledge to my students. I Learn as I teach which I feel is the best part of my profession. I strive to be the best version of myself.I am a hard worker and I make sure that I am well prepared in advance before I go to the class to teach my students.', 'Teacher', '1995-10-08', 27),
('sakha1', 'Saksha R', 8614523489, 'F', 'sakha@gmail.com', 'Kannada', 'Hindu', 'Brahmin', 'India', 'Mysuru', 'Karnataka', 'BBA, MBA', 10000000, 'I am an Assistant Manager at  Brokerage House. I pursued my education from the top Universities of India. I have a dream of starting my own venture.  For this to happen, my partner must be supportive and also financially stable.\r\n', 'Assistant Manager', '2000-05-05', 22),
('salman1', 'Salman Yusuf Khan', 75454785445, 'M', 'salman@gmail.com', 'Urdu', 'Muslim', 'Ashraf', 'India', 'Lucknow', 'Uttar Pradesh', 'Mechanical Engineer', 400000, 'I like exploring and implementing new ways to automate systems. I am also into\r\ndesigning and testing automation equipment and programming new automated components. My hobbies include watching and playing sports. I am someone with great leadership skills.', 'Automation Engineer', '1996-08-06', 26),
('sameer1', 'Sameer Kashyap', 8456129804, 'M', 'sameer@gmail.com', 'Kannada', 'Hindu', 'Brahmin', 'India', 'Mysuru', 'Karnataka', 'BA, Journalism', 500000, 'I am a Journalist by profession and a photographer by passion. I love travelling and exploring the world. I would love to go on a bike trip with my partner. Also, it would be great if my partner is good at cooking traditional delicacies.\r\n', 'SNR Journalist', '1998-01-15', 24),
('shairley1', 'Shirley Mitta', 8456912435, 'F', 'shairley@gmail.com', 'Hindi', 'Christian', 'Sahotra', 'India', 'Bengaluru', 'Karnataka', 'Computer Engineer', 700000, 'I am a Quality Analyst at a top MNC. I also love painting portraits. I can speak 10 different languages. My job offers me to travel around the world, so I would like my partner to travel with me.', 'Quality Analyst', '2002-10-04', 20),
('sukhwinder1', 'Sukhwinder Singh', 7581564157, 'M', 'sukhwinder@gmail.com', 'Punjabi', 'Sikh', 'Rajput', 'India', 'Ludhiana', 'Karnataka', 'BPharma', 600000, 'I am a pharmacist. I love playing chess and reading books. I am interested in politics.I am also a movie freak and I watch movies of all genres.I am looking for a partner who can cook well.', 'Pharmacuetical', '1996-04-12', 26);

